import React from "react";

const Home = () => {
  // Get the stored user data from localStorage
  const loggedInUser = JSON.parse(localStorage.getItem("loggedInUser"));

  return (
    <div>
      <h1>Welcome {loggedInUser?.name || "Guest"}</h1>
    </div>
  );
};

export default Home;
